document.addEventListener( 'DOMContentLoaded', function() {
    var splide = new Splide( '#my-slider', {
        perPage: 1,
        arrows: false,
    } );
    splide.mount();
} );


const form = document.querySelector('#form-site');
if(form){

    form.addEventListener('submit', function(e){
        e.preventDefault();
        let name = document.querySelector('#form-name');
        let email = document.querySelector('#form-email');
        let message = document.querySelector('#form-message');

        var params = new URLSearchParams();
        params.append('action', 'send_email');
        params.append('name', name.value);
        params.append('email', email.value);
        params.append('message', message.value);

        axios.post(inhealth_Public.url, params)
        .then(function(res) {
            if(res.status == 200) {
                name.value = '';
                email.value = '';
                message.value = '';
                document.querySelector('.res-form').innerHTML = 'El mensaje se envió correctamente';
            }
        })
        .catch(function(err) {
            console.error(err);
        })
        .then(function() {

        });

    });

}